         ad:"İleri Seviye f#",
         aciklama:"lorem ipsum",
         yazar:"aliveli",
         id:4
      }

   ])

   return (
      <div className="home">
         <BlogList bloglar={blogs}/>
      </div>
   );
}
export default Home;
